,228519,{awp=11503,b=1,crs={228430},f=32,lvl=60,q=4,u=1608}),s(226574,229381,{awp=11503,b=1,description="Use Shadowstrike to create this item.",f=29,lvl=58,providers={{"i",229380}},q=4,u=1608})}})}})}}),inst(760,{coords={{52.3,76.2,1445}},cost={{"i",16309,1},{"i",226500,1}},isRaid=1,lore="Onyxia is the daughter of the mighty dragon Deathwing, and sister of the scheming Nefarian, Lord of Blackrock Spire.\n\nIt is said that Onyxia delights in corrupting the mortal races by meddling in their political affairs. To this end it is believed that she takes on various humanoid forms and uses her charm and power to influence delicate matters between the different races. Some believe that Onyxia has even assumed an alias once used by her father - the title of the royal House Prestor. When not meddling in mortal concerns, Onyxia resides in a fiery cave below the Dragonmurk, a dismal swamp located within Dustwallow Marsh. There she is guarded by her kin, the remaining members of the insidious black dragonflight.",lvl=60,mapID=248,savedInstanceID=249,sourceQuests={6502,6602},u=1608,["zone-text-areaID"]=2159,g={h(-45,{q(7635,{awp=10001,c={3},coords={{47,24.48,1448}},cost={{"i",18705,1}},lvl=60,qgs={14525},rwp=40003,sourceQuests={7633},g={i(18724,{awp=10001,b=1,c={3},lvl=60,q=4,rwp=40003})}}),q(7634,{awp=10001,c={3},coords={{47,24.48,1448}},cost={{"i",18704,1}},lvl=60,maps={1452},qgs={14526},rwp=40003,sourceQuests={7633},g={i(18714,{awp=10001,b=1,c={3},f=113,lvl=60,q=4,rwp=40003})}}),q(84560,{awp=11503,coords={{67.2,85.1,1453}},lvl=60,qgs={1748},r=2,sourceQuests={7495},u=1608,g={i(228687,{awp=11503,b=1,f=52,q=4,u=1608}),i(228685,{awp=11503,b=1,f=51,q=4,u=1608}),i(228686,{awp=11503,b=1,f=53,q=4,u=1608})}}),q(7496,{coords={{67.2,85.1,1453}},lvl=60,qgs={1748},r=2,rwp=11503,sourceQuests={7495},u=2,g={i(18403,{b=1,f=52,q=4,rwp=11503,u=2}),i(18404,{b=1,f=51,q=4,rwp=11503,u=2}),i(18406,{b=1,f=53,q=4,rwp=11503,u=2})}}),q(84561,{awp=11503,coords={{32,37.8,1454}},lvl=60,qgs={4949},r=1,sourceQuests={7490},u=1608,g={i(228687,{awp=11503,b=1,f=52,q=4,u=1608}),i(228685,{awp=11503,b=1,f=51,q=4,u=1608}),i(228686,{awp=11503,b=1,f=53,q=4,u=1608})}}),q(7491,{coords={{32,37.8,1454}},lvl=60,qgs={4949},r=1,rwp=11503,sourceQuests={7490},u=2,g={i(18403,{b=1,f=52,q=4,rwp=11503,u=2}),i(18404,{b=1,f=51,q=4,rwp=11503,u=2}),i(18406,{b=1,f=53,q=4,rwp=11503,u=2})}}),q(84555,{awp=11503,c={1,2,4},description="You get this quest by looting Nostro's Compendium from bosses in Dire Maul.\n\nYou can also buy it on the Auction House for a hefty price!",lvl=60,maps={234},providers={{"i",228680}},u=1608,g={i(228695,{awp=11503,b=1,q=4,u=1608})}}),q(7507,{c={1,2},description="You get this quest by looting Nostro's Compendium from bosses in Dire Maul.\n\nYou can also buy it on the Auction House for a hefty price!",lvl=60,maps={234},providers={{"i",18401}},rwp=11503,u=2,g={i(18513,{b=1,q=4,rwp=11503})}}),q(84546,{awp=11503,c={3},coords={{47,24.48,1448}},description="You must defeat the 4 demons listed below by yourself with no pet in order to complete this quest.",lvl=60,maps={1428,1449,1451,1452},providers={{"i",18708}},qgs={14524},sourceQuests={7633},g={qo(1,{awp=10001,coords={{34.5,41.1,1449}},crs={14527,14533},description="There are two things that can make this fight difficult: her pet, a felhound named Precious and low nature resistance. Most hunters tend to CC Precious by freeze trapping it. Using ranged attacks is useless because she casts a debuff that substantially lowers ranged attack power. Your best bet is to use aspect of the wild + a greater nature protection potion (to dull and absorb her lightning bolts) and melee her until she falls.\n\nLocated in Ungoro Crater.",providers={{"i",18952}},rwp=40003}),qo(2,{awp=10001,coords={{25.3,65.9,1428}},crs={14529,14534},description="Use Concussive Shot/Serpent Sting to kite him down the road. You should know how long serpent sting lasts, use only one per trip down the road, more if you think you can risk it. As soon as it's worn off, drop an ice trap, let him stand in it, go to the other side, max range, and start again. If for whatever reason he breaks trap, you can use scatter shot, or use concussive shot to just keep kiting him in a circle until the cooldown finishes.\n\nDo not worry about his enrage, because he won't be touching you at all if you play right.\n\nLocated in the Burning Steppes.",providers={{"i",18953}},rwp=40003}),qo(3,{awp=10001,coords={{24.7,76,1451}},crs={14536,14530},description="This is the hardest demon:\n\nStrengths:\n* He does NOT predictably chase you. He frequently stops to fear (disorienting you and causing around 800 damage also) or will stop to shoot homing beetles at you.\n* The homing beetles basically prevent you from bandaging. They move extremely slow but hit extremely hard\n* If you leave melee range (further than 2-3 range or so), he uses an instant cast fear spell that also does 700-800 damage instantly, and he can cast these quickly, almost seemingly chain casting. Shadow protection potions do absorb this damage, however, even with greater potions, he tears through them very fast. It's also likely that the fear will send you into the homing beetles\n* Seemingly unlimited mana bar, so Viper Sting is useless\n* Scorpid sting has very little/no effect on him\n* Melees extremely hard and fast (200+) when in normal form\n\nWeaknesses:\n* If you use Rank 3 Wing Clip on him, it immobilizes him completely with \"Crippling Clip\" for 30 seconds.\n* The homing missiles (creepings) are not fired when you remain in melee range\n* He does NOT cast his fear when you remain in melee range\n* Must be 'chilled' via Frost Trap prior to fully engaging\n\nLocated in Silithus.",providers={{"i",18954}},rwp=40003}),qo(4,{awp=10001,coords={{60.3,13.2,1452}},crs={14531,14535},description="Kite him using Aspect of the Cheetah. Keep Serpent Sting on at all times and use Concussive Shot whenever he gets close. It is important to remain beyond 30 yards of the Demonic Doom, yet within range to use Arcane Shot so that he continues chasing you. If you rely completely on Serpent Sting for damage, he will break aggro and return to where he started. Once you apply Serpent Sting, count to 4, and apply it again before it wears off (the damage does stack). You will be able to see this by a 2nd damage listing \"Stinging Trauma\", which will continue to increase each time the sting is applied.\n\nBe sure to clear the area you plan on fighting so as to not get dazed by another NPC wandering by.\n\nLocated in Winterspring.",providers={{"i",18955}},rwp=40003}),i(228659,{awp=10001,b=1,cost={{"i",18724,1}},lvl=60,q=4,rwp=40003,g={s(224533,228334,{awp=10001,b=1,c={3},f=32,lvl=60,q=4,rwp=40003})}}),s(224532,228332,{awp=10001,b=1,c={3},description="Go back to Felwood after having completed all the quests and a chat icon will become available, allowing you to interact with one of the ancients. Speak to him and he will give you the staff.",f=28,lvl=60,q=4,rwp=40003,sourceQuests={7634,7635,84546}})}}),q(7636,{awp=10001,c={3},coords={{47,24.48,1448}},description="You must defeat the 4 demons listed below by yourself with no pet in order to complete this quest.",lvl=60,maps={1428,1449,1451,1452},providers={{"i",18708}},qgs={14524},rwp=40003,sourceQuests={7633},g={i(18707,{awp=10001,b=1,cost={{"i",18724,1}},lvl=60,q=4,rwp=40003,g={s(163648,18713,{awp=10001,b=1,c={3},f=32,lvl=60,q=4,rwp=40003})}}),s(163649,18715,{awp=10001,b=1,c={3},description="Go back to Felwood after having completed all the quests and a chat icon will become available, allowing you to interact with one of the ancients. Speak to him and he will give you the staff.",f=28,lvl=60,q=4,rwp=40003,sourceQuests={7634,7635,7636}})}}),q(84556,{awp=11503,c={1,2,4},lvl=60,maps={234},providers={{"i",228695}},qgs={14368},sourceQuests={84555},u=1608}),q(7508,{c={1,2},lvl=60,maps={234},providers={{"i",18513}},qgs={14368},rwp=11503,sourceQuests={7507},u=2}),q(84557,{awp=11503,c={1,2,4},lvl=60,maps={234},qgs={14368}