d. In the fight itself, tanks must taunt swap to avoid massive stacks of Crunch Armor, while other members of the raid must deal with Ghamoo-ra's shield, Aqua Shell - Deal damage to break it. Once Aqua Shell is broken, DPS the turtle down while dealing with massive raid-wide damage!",rwp=20001,u=1605,g={s(190758,209436,{awp=11500,b=1,f=20,lvl=25,q=3,rwp=20001,u=1605}),s(191032,209830,{awp=11500,b=1,f=33,lvl=25,q=3,rwp=20001,u=1605}),s(190752,209424,{awp=11500,b=1,f=8,lvl=25,q=3,rwp=20001,u=1605}),s(190805,209523,{awp=11500,b=1,f=3,lvl=25,q=3,rwp=20001,u=1605}),s(190928,209678,{awp=11500,b=1,f=5,lvl=25,q=3,rwp=20001,u=1605}),s(191030,209824,{awp=11500,b=1,f=6,lvl=25,q=3,rwp=20001,u=1605}),s(190750,209418,{awp=11500,b=1,f=6,lvl=25,q=3,rwp=20001,u=1605}),s(190926,209675,{awp=11500,b=1,f=4,lvl=25,q=3,rwp=20001,u=1605}),s(190806,209524,{awp=11500,b=1,f=5,lvl=25,q=3,rwp=20001,u=1605}),s(190757,209432,{awp=11500,b=1,f=4,lvl=25,q=3,rwp=20001,u=1605})}}),n(204068,{awp=11500,description="Lady Sarevess is accompanied by a tanky Blackfathom Elite that needs to be off-tanked. The main mechanic players must deal with is Freezing Arrow, in which a player is randomly targetted by an arrow that leaves a frost patch that the off-tank can move the Blackfathom Elite to stun it for a short duration. In addition to this, spread out to not chain Forked Lightning damage!",rwp=20001,u=1605,g={s(190846,209564,{awp=11500,b=1,f=29,lvl=25,q=3,rwp=20001,u=1605}),s(190807,209525,{awp=11500,b=1,f=25,lvl=25,q=3,rwp=20001,u=1605}),s(190845,209563,{awp=11500,b=1,f=32,lvl=25,q=3,rwp=20001,u=1605}),s(191029,209822,{awp=11500,b=1,f=23,lvl=25,q=3,rwp=20001,u=1605}),s(194422,211789,{awp=11500,b=1,f=5,lvl=25,q=3,rwp=20001,u=1605}),s(194431,211843,{awp=11500,b=1,f=6,lvl=25,q=3,rwp=20001,u=1605}),s(194430,211842,{awp=11500,b=1,f=4,lvl=25,q=3,rwp=20001,u=1605}),s(190930,209680,{awp=11500,b=1,f=3,lvl=25,q=3,rwp=20001,u=1605}),s(190929,209679,{awp=11500,b=1,f=4,lvl=25,q=3,rwp=20001,u=1605}),s(190809,209527,{awp=11500,b=1,f=5,lvl=25,q=3,rwp=20001,u=1605}),s(190847,209566,{awp=11500,b=1,f=6,lvl=25,q=3,rwp=20001,u=1605}),i(209565,{awp=11500,b=1,f=52,lvl=25,q=3,rwp=20001,u=1605}),i(209823,{awp=11500,b=1,c={3},f=52,lvl=25,q=3,rwp=20001,u=1605})}}),n(204921,{awp=11500,description="Gelihast has a quite dangerous curse with Curse of Blackfathom, so you must have ways to decurse it off. The raid must avoid getting hit by Shadow Crash while the tanks taunt swap to prevent reaching high stacks of Shadow Strike. Healers can also dispel the random Fear he throws at people.\n\nThe big mechanic happens once the boss reaches 10% - March of the Murlocs will begin, spawning dozens of murlocs that players must dodge while the boss heals himself and throws more Shadow Crashes. Once fully healed, the fight starts again, with Gelihast summoning low-health Blackfathom Tendril that must be killed. Gelihast will heal himself to full twice with March of the Murlocs before finally dying.",rwp=20001,u=1605,g={s(190848,209567,{awp=11500,b=1,f=22,lvl=25,q=3,rwp=20001,u=1605}),s(190852,209571,{awp=11500,b=1,f=27,lvl=25,q=3,rwp=20001,u=1605}),s(190841,209559,{awp=11500,b=1,f=28,lvl=25,q=3,rwp=20001,u=1605}),s(190854,209573,{awp=11500,b=1,f=28,lvl=25,q=3,rwp=20001,u=1605}),s(190851,209570,{awp=11500,b=1,f=1,lvl=25,q=3,rwp=20001,u=1605}),i(209820,{awp=11500,b=1,f=51,lvl=25,q=3,rwp=20001,u=1605}),s(190849,209568,{awp=11500,b=1,f=6,lvl=25,q=3,rwp=20001,u=1605}),s(190853,209572,{awp=11500,b=1,f=5,lvl=25,q=3,rwp=20001,u=1605}),s(190850,209569,{awp=11500,b=1,f=5,lvl=25,q=3,rwp=20001,u=1605}),s(190922,209670,{awp=11500,b=1,f=4,lvl=25,q=3,rwp=20001,u=1605}),i(209821,{awp=11500,b=1,f=52,lvl=25,q=3,rwp=20001,u=1605}),i(209681,{awp=11500,b=1,f=53,lvl=25,q=3,rwp=20001,u=1605}),i(211491,{awp=11500,b=1,f=113,q=4,rwp=20001,u=1605})}}),n(207356,{awp=11500,description="Lorgus Jett can be found behind a gauntlet of Naga and Murlocs that must be dealt with before engaging the boss itself. Lorgus Jett himself has 3 totems he will use - One totem is spawned every 10 seconds in a set order. You can simply ignore two out of the three totems and DPS Lorgus Jett:\n\n    Corrupted Windfury Totem - Ignore and tank through his enhanced attacks;\n    Corrupted Lightning Shield Totem - Kill this totem immediately once it spawns;\n    Corrupted Molten Fury Totem - Ignore this totem and dodge the molten boulders it spawns.",rwp=20001,u=1605,g={s(190857,209579,{awp=11500,b=1,f=34,lvl=25,q=3,rwp=20001,u=1605}),s(190855,209577,{awp=11500,b=1,f=24,lvl=25,q=3,rwp=20001,u=1605}),s(190842,209560,{awp=11500,b=1,f=23,lvl=25,q=3,rwp=20001,u=1605}),s(191028,209818,{awp=11500,b=1,f=20,lvl=25,q=3,rwp=20001,u=1605}),s(190931,209682,{awp=11500,b=1,f=5,lvl=25,q=3,rwp=20001,u=1605}),s(190856,209578,{awp=11500,b=1,f=5,lvl=25,q=3,rwp=20001,u=1605}),s(190859,209581,{awp=11500,b=1,f=6,lvl=25,q=3,rwp=20001,u=1605}),i(209575,{awp=11500,b=1,f=54,lvl=25,q=3,rwp=20001,u=1605}),i(209574,{awp=11500,b=1,f=54,lvl=25,q=3,rwp=20001,u=1605}),i(209576,{awp=11500,b=1,f=54,lvl=25,q=3,rwp=20001,u=1605})}}),n(209678,{awp=11500,description="Kelris is a two-phase fight with Phase 1 starting on pull and Phase 2 starting at 35%, so DPS must hold their big cooldowns until Kelris enters Phase 2. Through the fight, players must dodge Shadow Crashes and interrupt Shadowy Chains (priority) and Mind Blast.\n\nThe main difficult in the fight is the Dream Realm mechanic - Every so often, the two closest players to Kelris will be put to Sleep, being sent to a Dream Realm in which they need to kill neutral Phantasmal Priestesses for a chance to spawn a portal to be sent back to reality. After 30 seconds in the Dream Phase, the Priestesses will become aggressive and attack the two players on the Dream Realm. If possible, avoid using casters to go to the Dream Realm, as the Priestesses have high magical resistance.\n\nOnce Kelris reaches 35%, Phase 2 will start - Kelris will no longer send players to the Dream Realm, but will deal increased damage, in addition to his previous interruptible spells now being immune to interrupts. Save your resources and spread around the room to burn the boss down!",rwp=20001,u=1605,g={s(190843,209561,{awp=11500,b=1,f=28,lvl=25,q=4,rwp=20001,u=1605}),s(190941,209694,{awp=11500,b=1,f=20,lvl=25,q=3,rwp=20001,u=1605}),s(190925,209674,{awp=11500,b=1,f=27,lvl=25,q=3,rwp=20001,u=1605}),s(194137,211458,{awp=11500,b=1,f=1,lvl=25,q=3,rwp=20001,u=1605}),i(209673,{awp=11500,b=1,f=51,lvl=25,q=3,rwp=20001,u=1605}),i(209686,{awp=11500,b=1,f=51,lvl=25,q=3,rwp=20001,u=1605}),i(209817,{awp=11500,b=1,f=51,lvl=25,q=3,rwp=20001,u=1605}),s(190924,209672,{awp=11500,b=1,f=4,lvl=25,q=3,rwp=20001,u=1605}),s(194134,211455,{awp=11500,b=1,f=5,lvl=25,q=3,rwp=20001,u=1605}),s(194136,211457,{awp=11500,b=1,f=6,lvl=25,q=3,rwp=20001,u=1605}),s(190920,209667,{awp=11500,b=1,f=4,lvl=25,q=3,rwp=20001,u=1605}),i(209668,{awp=11500,b=1,f=52,lvl=25,q=3,rwp=20001,u=1605}),i(209816,{awp=11500,b=1,c={9},f=53,lvl=25,q=3,rwp=20001,u=1605}),i(211492,{awp=11500,b=1,c={9},f=113,q=4,rwp=20001,u=1605})}}),n(213334,{awp=11500,description="Once engaged, all raid members should stay close to Aku'mai at all times, to easily dodge the Corrosive Blast cones. Getting hit by this gives a stack of Corrosion. Tanks will naturally be affected with Corrosion over time, and once they reach 3-4 stacks of Corrosion, they must drag themselves and the boss to one of the four Cleansing Pool scattered across the room - Cleansing themselves and generating adds that must be killed.\n\nOnce Aku'mai hits 50%, he will enter Phase 2 by casting Dark Protection becoming big and voidlike. His abilities remain mostly the same, but now deal Shadow damage instead of Nature. The main difference is that Corrosion becomes Shadow Seep, and tanks must taunt swap to avoid getting high stacks of the debuff. It is possible to cleanse these the same way as you did Corrosion in Phase 1, but it is largely unnecessary if your DPS is good.",rwp=20001,u=1605,g={i(209693,{aw