to avoid the poison pools. Gunk must be cleansed ASAP.\n\nThe boss will gain speed from Slime Time throughout the fight, to stop this: kill the Atal'ai Slab, Atal'ai Mask, Atal'ai Candle, and Atal'ai Drum objects which are located along the corridor. Ideally, have the melee focus on this to avoid getting Devoured themselves.",rwp=20001,u=1607,g={s(218639,220569,{awp=11502,b=1,f=24,lvl=50,q=4,rwp=20001,u=1607}),s(218640,220571,{awp=11502,b=1,f=32,lvl=50,q=4,rwp=20001,u=1607}),s(218592,220518,{awp=11502,b=1,f=5,lvl=50,q=3,rwp=20001,u=1607}),s(218608,220538,{awp=11502,b=1,f=4,lvl=50,q=4,rwp=20001,u=1607}),s(218610,220540,{awp=11502,b=1,f=7,lvl=50,q=3,rwp=20001,u=1607}),s(218611,220541,{awp=11502,b=1,f=7,lvl=50,q=3,rwp=20001,u=1607}),s(218615,220545,{awp=11502,b=1,f=5,lvl=50,q=3,rwp=20001,u=1607}),s(218616,220546,{awp=11502,b=1,f=5,lvl=50,q=3,rwp=20001,u=1607}),s(218612,220542,{awp=11502,b=1,f=6,lvl=50,q=3,rwp=20001,u=1607}),s(218620,220550,{awp=11502,b=1,f=5,lvl=50,q=3,rwp=20001,u=1607}),s(218622,220552,{awp=11502,b=1,f=6,lvl=50,q=3,rwp=20001,u=1607}),s(218635,220565,{awp=11502,b=1,f=4,lvl=50,q=3,rwp=20001,u=1607}),i(221484,{awp=11502,b=1,lvl=50,q=4,rwp=20001,u=1607}),i(221281,{awp=11502,q=3,rwp=20001,u=1607})}}),h(-367,{awp=11502,description="The Atal'ai Defenders are the third boss encounter in The Temple of Atal'Hakkar.\n\nGasher & Mijan's abilities are the most threatening.\n\nOnce killed, each boss will respawn as an undead. Do not attack them, instead use Shackle Undead and Freezing Trap to CC them.",rwp=20001,u=1607,g={n(221637,{awp=11502,description="|cffff0000Fervor|r can cause him to deal a lot of damage, focus him down fast; if needed, the tank can run away from Gasher while still in range of casters to minimize the damage taken if Gasher gets high stacks.\n\nSpinning Axes - Spawns spinning axes around him, this deals minor cleave damage.",rwp=20001,u=1607,g={s(218712,220674,{awp=11502,b=1,f=20,lvl=50,q=4,rwp=20001,u=1607}),s(218660,220591,{awp=11502,b=1,f=2