her boss into the raid.\n\nFor positioning, you really want to avoid getting knocked back into both the outside poison pool which surrounds the boss arena, as well as the middle pit which will cause you to die from fall damage by either of the wing buffet abilities. To avoid the pit you should either stand next to it so that you get knocked back parallel to it; or stand right against it to get knocked over to the opposite side of it. Doing either, depending on what's easier for you at that moment, will gain you uptime on casting.\n\nIdeally, have all of the damage dealers focusing a single boss as the bosses share health pools. This way you'll be focusing a fully debuffed target.",providers={{"n",220864}},rwp=20001,u=1607,g={s(218653,220584,{awp=11502,b=1,f=25,lvl=50,q=3,rwp=20001,u=1607}),s(218656,220587,{awp=11502,b=1,f=20,lvl=50,q=4,rwp=20001,u=1607}),s(218663,220594,{awp=11502,b=1,f=29,lvl=50,q=4,rwp=20001,u=1607}),s(218636,220566,{awp=11502,b=1,f=29,lvl=50,q=4,rwp=20001,u=1607}),s(218650,220581,{awp=11502,b=1,f=23,lvl=50,q=4,rwp=20001,u=1607}),s(218594,220521,{awp=11502,b=1,f=5,lvl=50,q=3,rwp=20001,u=1607}),s(218593,220519,{awp=11502,b=1,f=5,lvl=50,q=3,rwp=20001,u=1607}),s(218675,220609,{awp=11502,b=1,f=3,lvl=50,q=3,rwp=20001,u=1607}),s(218606,220536,{awp=11502,b=1,f=4,lvl=50,q=3,rwp=20001,u=1607}),s(218614,220544,{awp=11502,b=1,f=5,lvl=50,q=3,rwp=20001,u=1607}),s(218619,220549,{awp=11502,b=1,f=4,lvl=50,q=3,rwp=20001,u=1607}),s(218621,220551,{awp=11502,b=1,f=5,q=3,rwp=20001,u=1607}),i(221298,{awp=11502,q=3,rwp=20001,u=1607})}}),n(218721,{awp=11502,description="This fight has two different versions which rotate every week.\n\nOne where Ogom the Wretched dies first, making Jammal'an the Prophet the main boss.\n Mass Penance is a spoopy mechanic.\n\nThe other where Jammal'an the Prophet dies first, making Ogom the Wretched the main boss.\n Avoid Consecration.",providers={{"n",218718}},rwp=20001,u=1607,g={s(218645,220576,{awp=11502,b=1,f=21,lvl=50,q=3,rwp=20001,u=1